import React from 'react';
import "./styles.css"

function header() {
  return (
    <header>
        <div className='name'>
            <h1><span>T</span>hiago <span>M</span>artins</h1>
        </div>
        <div className='routes'>
            <div className="sep">
                <a href="">Home</a>
            </div>
            <div className="sep">
                <a href="">Sobre Mim</a>

            </div>
            <div className="sep">
                <a href="">Projetos</a>
            </div>
        </div>
    </header>
  );
}

export default header;
